webpackJsonp([65069249961651],{3405:function(e,o){e.exports={pathContext:{docHtml:'<h1>CHANGELOG</h1>\n<h3>4.2.0 (2018/06/11)</h3>\n<ul>\n<li>[#26] Do not use copy-by-value for <code>this.level</code>.</li>\n<li>[#25] Wrap calls to <code>format.transform</code> with try / catch.</li>\n<li>[#24] Use <code>readable-stream</code> package to get the _final semantics across all versions of Node.</li>\n</ul>\n<h3>4.1.0 (2018/05/31)</h3>\n<ul>\n<li>[#23] Revert to prototypal-based syntax for backwards compatibility.</li>\n</ul>\n<h3>4.0.0 (2018/05/24)</h3>\n<ul>\n<li><strong>BREAKING</strong> Update transports to use ES6 classes. Creation of\n<code>TransportStream</code> and <code>LegacyTransportStream</code> now requires the <code>new</code> keyword.</li>\n</ul>\n<p><strong>No longer works</strong></p>\n<pre><code class="language-js">const Transport = require(\'winston-transport\');\nconst transport = Transport({\n  log: (info, callback) => { /* log something */ }\n});\n</code></pre>\n<p><strong>Do this instead</strong></p>\n<pre><code class="language-js">const Transport = require(\'winston-transport\');\nconst transport = new Transport({\n  log: (info, callback) => { /* log something */ }\n});\n</code></pre>\n<h3>3.3.0 (2018/05/24)</h3>\n<p><strong>Unpublished:</strong> overlooked that 26f816e introduced a breaking change.</p>\n<ul>\n<li>[#21] Do not log when there is no info object.</li>\n<li>[#20] Add silent options to typings.</li>\n<li>[#19] Refactor test fixtures to use es6-classes.</li>\n<li>[#18] Use triple-beam for info object constants.</li>\n<li>[#17] Add linting and Node v10 to the travis build of the project.</li>\n</ul>\n<h3>3.2.1 (2018/04/25)</h3>\n<ul>\n<li>[#16] Reorder in TS defs: namespace must come after class in order for delcaration merging to work as expected.</li>\n</ul>\n<h3>3.2.0 (2018/04/22)</h3>\n<ul>\n<li>[#13] Add silent support to LegacyTransportStream. Fixes [#8].</li>\n<li>[#14] Ensure that if a Transport-specific format is provided it is invoked on each chunk before passing it to <code>.log</code>. Fixes [#12]. </li>\n<li>[#11] Revice <code>d.ts</code></li>\n<li>Add <code>.travis.yml</code>.</li>\n<li>\n<p>Documentation updates:</p>\n<ul>\n<li>[#5] Update deprecated link.</li>\n<li>[#7] Correct <code>this</code> reference in <code>README.md</code> by using an arrow function.</li>\n</ul>\n</li>\n</ul>\n<h3>3.1.0 (2018/04/06)</h3>\n<ul>\n<li>[#10] Add <code>silent</code> option to <code>TransportStream</code>. Still needs to be implemented\nfor <code>LegacyTransportStream</code>.</li>\n<li>Bump <code>mocha</code> to <code>^5.0.5</code>.</li>\n<li>Bump <code>nyc</code> to <code>^11.6.0</code>.</li>\n</ul>\n<h3>3.0.1 (2017/10/01)</h3>\n<ul>\n<li>[#4] Use ES6-class for defining Transport in <code>README.md</code>.</li>\n<li>[#4] Do not overwrite prototypal methods unless they are provided in the options.</li>\n</ul>\n<h3>3.0.0 (2017/09/29)</h3>\n<ul>\n<li>Use <code>Symbol.for(\'level\')</code> to lookup immutable <code>level</code> on <code>info</code> objects.</li>\n</ul>\n<h3>2.1.1 (2017/09/29)</h3>\n<ul>\n<li>Properly interact with the <code>{ format }</code>, if provided.</li>\n</ul>\n<h3>2.1.0 (2017/09/27)</h3>\n<ul>\n<li>If a format is defined use it to mutate the info.</li>\n</ul>\n<h3>2.0.0 (2017/04/11)</h3>\n<ul>\n<li>\n<p><a href="https://github.com/winstonjs/winston-transport/pull/2">#2</a> Final semantics for <code>winston-transport</code> base implementations:</p>\n<ul>\n<li><code>TransportStream</code>: the new <code>objectMode</code> Writable stream which should be the base for all future Transports after <code>winston >= 3</code>.</li>\n<li><code>LegacyTransportStream</code>: the backwards compatible wrap to Transports written for <code>winston &#x3C; 3</code>. There isn\'t all that much different for those implementors except that <code>log(level, message, meta, callback)</code> is now <code>log(info, callback)</code> where <code>info</code> is the object being plumbed along the objectMode pipe-chain. This was absolutely critical to not "break the ecosystem" and give <a href="https://www.npmjs.com/search?q=winston">the over 500 Transport package authors</a> an upgrade path.</li>\n<li>Along with all the code coverage &#x26; <code>WritableStream</code> goodies:</li>\n<li>100% code coverage for <code>TransportStream</code></li>\n<li>100% code coverage for <code>LegacyTransportStream</code></li>\n<li>Implementation of <code>_writev</code> for  <code>TransportStream</code></li>\n<li>Implementation of <code>_writev</code> for  <code>LegacyTransportStream</code></li>\n</ul>\n</li>\n</ul>\n<h3>1.0.2 (2015/11/30)</h3>\n<ul>\n<li>Pass the write stream callback so that we can communicate backpressure up the chain of streams.</li>\n</ul>\n<h3>1.0.1 (2015/11/22)</h3>\n<ul>\n<li>First <code>require</code>-able version.</li>\n</ul>\n<h3>1.0.0 (2015/11/22)</h3>\n<ul>\n<li>Initial version.</li>\n</ul>',docPath:"argo-ci/node_modules/winston-transport/changelog",proj:"argo-ci"}}}});
